import React from 'react'
import ReactDom from 'react-dom'

// CSS
import './index.css'

function BookList() {
  return (
    <section className='booklist'>
      <Book />
    </section>
  )
}

const Book = () => {
  const title = 'TensorFlow book'
  const author = 'John Reed'

  return (
    <article className='book'>
      <img src='https://images-na.ssl-images-amazon.com/images/I/81kv0vHJ0QL._AC_UL240_SR240,240_.jpg' alt=''/>
      <h1>{ title }</h1>
      <h4>{ author }</h4>
    </article>
  )
}

ReactDom.render(<BookList />, document.getElementById('root'))
